\u007d\u0061\u0039\u004d\u0078\u0052\u006a\u006c\u0049\u002c\u006e\u0026\u0069\u0070\u0075\u002f\u003c\u0031\u005b\u0025\u0021\u0067\u0034\u0040\u006c\u0078\u003c\u005a\u007e\u0059\u0048\u0064\u0031\u0053\u004e\u004f\u002b\u0055\u006a\u0040\u0021\u0069\u0052\u004c\u0077\u005f\u003a\u005f\u0043\u0038\u004b\u0078\u0049\u0054\u002a\u0026\u0046\u0028\u0044\u004b\u004d\u0057\u0067\u002f\u0022\u0022\u0078\u0071\u0069\u0067\u003d\u005e\u004a\u0061\u0042\u004c\u003c\u0059\u004f\u002f\u0024\u0022\u0030\u0070\u0059\u0026\u004b\u007b\u0056\u002a\u003c\u0031\u0072\u007e\u0066\u0057\u0062\u007a\u0079\u0062\u006b\u0047\u0066\u005f\u005a\u0076\u0044\u004b\u0062\u0062\u0048\u0072\u006b\u007a\u0069\u003d\u0052\u006e\u0060\u005d\u0044\u007a\u003a\u003b\u0045\u006c\u005d\u002f\u0032\u006a\u0050\u0023\u003b\u0055\u007d\u005a\u0044\u007a\u0026\u007d\u0057\u004f\u0064\u006e\u0031\u0022\u0040\u0062\u0056\u004d\u003a\u0024\u0034\u0035\u0021\u0062\u0035\u007e\u0066\u0057\u0079\u0034\u0043\u0050\u004f\u0055\u0034\u003d\u0033\u0041\u003e\u0043\u006b\u0055\u004a\u002a\u0041\u0040\u007a\u007a\u005b\u0055\u0055\u002f\u005d\u0042\u0043\u0029\u005e\u0067\u0044\u002f\u0077\u0053\u004e\u004f\u0068\u0065\u0034\u004e\u0044\u0069\u0029\u0054\u0060\u0021\u0077\u002e\u0079\u0028\u006d\u0039\u0021\u0067\u0065\u003f\u003c\u0061\u006a\u0062\u003d\u006d\u0077\u0049\u006e\u0034\u006d\u0039\u0021\u0067\u0065\u003f\u003c\u0061\u006a\u0062\u003d\u006d\u0077\u0049\u0053\u003f\u007c\u004d\u0029\u0047\u006a\u006c\u002e\u002a\u004c\u0054\u004b\u0055\u0058\u007b\u005d\u003f\u003c\u007b\u0023\u0067\u0058\u0075\u005a\u002c\u0044\u004b\u0050\u0065\u0053\u0079\u0073\u0025\u007e\u0036\u0050\u006e\u006a\u006c\u0049\u002c\u0075\u0046\u0034\u0045\u006a\u006b\u002e\u0079\u0030\u0070\u0077\u0070\u003c\u0026\u003e\u0057\u0052\u0022\u0065\u0039\u005b\u006f\u0041\u0040\u005a\u0058\u005b\u004d\u004f\u007b\u0054\u0042\u0051\u0042\u0057\u004f\u0064\u006e\u0031\u0022\u0040\u0062\u0056\u004d\u0043\u004b\u0046\u0057\u005a\u0024\u0025\u004b\u0045\u002a\u0039\u003e\u003c\u0074\u0042\u0053\u0055\u007c\u0047\u0031\u0031\u0039\u005b\u0077\u0054\u0065\u0035\u0053\u004e\u004f\u003b\u0059\u0023\u0066\u0058\u0030\u0038\u005a\u0071\u007e\u0066\u0057\u0079\u0034\u0043\u0050\u004f\u0055\u0034\u003d\u0064\u0035\u006c\u0025\u003b\u004d\u003d\u0047\u0056\u0038\u0067\u0025\u0021\u0067\u0028\u002f\u004a\u002b\u0047\u0026\u0033\u004b\u0061\u003c\u0041\u0040\u007a\u007a\u005b\u0055\u0055\u002f\u005d\u0042\u0040\u0053\u0035\u0030\u004e\u0079\u0041\u0040\u007a\u007a\u005b\u0055\u0055\u002f\u005d\u0042\u0043\u0029\u003a\u0067\u0046\u002f\u0077\u0053\u004e\u004f\u0068\u0065\u0034\u004e\u0044\u0069\u0029\u0054\u002e\u0064\u0044\u002f\u0075\u0033\u0058\u0061\u004d\u0029\u003c\u003d\u006c\u002b\u007c\u005a\u007e\u0037\u0067\u002f\u0024\u0033\u0058\u0061\u004d\u0029\u003c\u003d\u006c\u002b\u007c\u005a\u0042\u0022\u0043\u0072\u0031\u0039\u0058\u0061\u004d\u0029\u003c\u003d\u006c\u002b\u007c\u005a\u0042\u0022\u0023\u0057\u0024\u0053\u004e\u004f\u0068\u0065\u0034\u004e\u0044\u0069\u0029\u0054\u0060\u0021\u0077\u002e\u0053\u0025\u006d\u0039\u0021\u0067\u0065\u003f\u003c\u0061\u006a\u0062\u003d\u006d\u005e\u002e\u0061\u007a\u006d\u0039\u0021\u0067\u0065\u003f\u003c\u0061\u006a\u0062\u003d\u006d\u0077\u0049\u0053\u003f\u007c\u004d\u0028\u0048\u005d\u0033\u004a\u0061\u002c\u005a\u0064\u0055\u003d\u0057\u007e\u006a\u0063\u004f\u0029\u0046\u0061\u0040\u0051\u0069\u0033\u0050\u0059\u006d\u0046\u0072\u0031\u0053\u004e\u004f\u003b\u0059\u0023\u0066\u0058\u0030\u0038\u005a\u0044\u006d\u007d\u005d\u006b\u005f\u0058\u0024\u0078\u0073\u0076\u004b\u0076\u0048\u005b\u0069\u003c\u007e\u0066\u0057\u0062\u007a\u007b\u0074\u0043\u004d\u006e\u0038\u0062\u0035\u003b\u0036\u0065\u0039\u0044\u003f\u0063\u002a\u007c\u0069\u004d\u004b\u0034\u004b\u0063\u0034\u0039\u0026\u002b\u0074\u007c\u0038\u0048\u0077\u002e\u0070\u0052\u0026\u004b\u007b\u0056\u002a\u003c\u0031\u0072\u007e\u0066\u0057\u0079\u0034\u0043\u0050\u004f\u0055\u0034\u003d\u0050\u002c\u0044\u004b\u0062\u0062\u0048\u0072\u006b\u007a\u0069\u003d\u0064\u0068\u006a\u006c\u0045\u0046\u0071\u0026\u0040\u0045\u0025\u0072\u003e\u0031\u0073\u0039\u0030\u004b\u006e\u0052\u003e\u0057\u006d\u005b\u0046\u0059\u0076\u0067\u006e\u0023\u006b\u003c\u004d\u0042\u0073\u0053\u0070\u0048\u0073\u0025\u0067\u005d\u0077\u0030\u0062\u005f\u0058\u0061\u004d\u0029\u0073\u005f\u005a\u0069\u0077\u0046\u0048\u0022\u003e\u0058\u0041\u0037\u0070\u0028\u0048\u004d\u0044\u0072\u0041\u006a\u0031\u0035\u0043\u0039\u0053\u0067\u0042\u0023\u0054\u007a\u0065\u0068\u0039\u0063\u002e\u0035\u0044\u004b\u0028\u0056\u0049\u002a\u0055\u0036\u0053\u0050\u0063\u0065\u0054\u0034\u006c\u0043\u005f\u0031\u005f\u004d\u006f\u003f\u0042\u0038\u0067\u0025\u0021\u0067\u0028\u002f\u004d\u0069\u005f\u005a\u0026\u0026\u0049\u002e\u0041\u0040\u0078\u003c\u0064\u0047\u0070\u005a\u007e\u0061\u0037\u004c\u007a\u005f\u0064\u0038\u003f\u002b\u007c\u0069\u0034\u004c\u0030\u005e\u004a\u0061\u0055\u0062\u0042\u0055\u0045\u002a\u0059\u0034\u0028\u0075\u0021\u0067\u0070\u0052\u006f\u007a\u002f\u004b\u003e\u0059\u0038\u0072\u0039\u0022\u0044\u0039\u007d\u0046\u0061\u0040\u002a\u0042\u004f\u0062\u0057\u006c\u0021\u007b\u006c\u005e\u0057\u0062\u0047\u004a\u006a\u006c\u0045\u0046\u0071\u0026\u0040\u0045\u0025\u0072\u003e\u0031\u004a\u0023\u0048\u0055\u0031\u005e\u004a\u0061\u002c\u005a\u0064\u0055\u003d\u0057\u007e\u006a\u003f\u0023\u0061\u0065\u0028\u002b\u0046\u0057\u005a\u0024\u0068\u002e\u0044\u002f\u0041\u0037\u0036\u0039\u0039\u0052\u0058\u0075\u005a\u002c\u0044\u004b\u0062\u0062\u0048\u0072\u006b\u007a\u0069\u003d\u0064\u0068\u006a\u006c\u0045\u0046\u0071\u0026\u0040\u0045\u0025\u0072\u003e\u0031\u0028\u0075\u0021\u0067\u0028\u002f\u004d\u0069\u005f\u005a\u0026\u0026\u0049\u002e\u0063\u002b\u0045\u0023\u002e\u006e\u006a\u006c\u0045\u0046\u005b\u0062\u0065\u006d\u0052\u0064\u0055\u0036\u004f\u0023\u003f\u0055\u0031\u0071\u0062\u0035\u0044\u004b\u0028\u0056\u0049\u002a\u0055\u0036\u0053\u0050\u0063\u0065\u0065\u0033\u004a\u0061\u007a\u004b\u0028\u0045\u0046\u002f\u005b\u0028\u0068\u004f\u0025\u0052\u0054\u005a\u004e\u0051\u0068\u0053\u0057\u004f\u0074\u003b\u006e\u0034\u0028\u0023\u0033\u0058\u006b\u0059\u0028\u0078\u003a\u0042\u007a\u005f\u0066\u0055\u0076\u0079\u0058\u0061\u004d\u0029\u0057\u0035\u0021\u0069\u0050\u0063\u0025\u0026\u0061\u003c\u0041\u0040\u0041\u0063\u006a\u0065\u003f\u0068\u0036\u0035\u0071\u0042\u0069\u006d\u0059\u002e\u0038\u005e\u0024\u0025\u006b\u0047\u0054\u0034\u0030\u0048\u002c\u0039\u0076\u0074\u004c\u0065\u0035\u0053\u004e\u004f\u0063\u004d\u0049\u002f\u006d\u0061\u003a\u0050\u0072\u003f\u003a\u002e\u0041\u0040\u005a\u0058\u0048\u0055\u0079\u003d\u0057\u0030\u002f\u004b\u004f\u0022\u0076\u005d\u003a\u007b\u0048\u007c\u005f\u0070\u0023\u002f\u0063\u0034\u0045\u007a\u0043\u0039\u0053\u0067\u0042\u0023\u0054\u007a\u0062\u004e\u006a\u006c\u0049\u002c\u004d\u0026\u0022\u004b\u0046\u007b\u0023\u0079\u0058\u0061\u004d\u0029\u0057\u0035\u0021\u0069\u0050\u0063\u0025\u0026\u0059\u002e\u0021\u0035\u0029\u0078\u0069\u0073\u0023\u0026\u0046\u0028\u0044\u004b\u0050\u0065\u0053\u0079\u0073\u0025\u007e\u0036\u0045\u0048\u006a\u006c\u0045\u0046\u0071\u0026\u0040\u0045\u0025\u0072\u003e\u0031\u0060\u0023\u0072\u0047\u003e\u005e\u0046\u0057\u005a\u0024\u0068\u002e\u0044\u002f\u0041\u0037\u0036\u0039\u0052\u006e\u0050\u005f\u0045\u002b\u0044\u004b\u0028\u0056\u0049\u002a\u0055\u0036\u0053\u0050\u0063\u0065\u0050\u0060\u003a\u0044\u004e\u0047\u0031\u005e\u004a\u0061\u002c\u005a\u0064\u0055\u003d\u0057\u007e\u006a\u003f\u0023\u0042\u004e\u002e\u003d\u006c\u0078\u0033\u003b\u0045\u006c\u0047\u007b\u0061\u007a\u0068\u004f\u0060\u0059\u0058\u0054\u0072\u007a\u0078\u0038\u0021\u0068\u0034\u0067\u0067\u0076\u0078\u007a\u0062\u004e\u006a\u006c\u0045\u0046\u0071\u0026\u0040\u0045\u0025\u0072\u003e\u0031\u0028\u0075\u0021\u0067\u0070\u0052\u006f\u007a\u002f\u004b\u003e\u0059\u003b\u002f\u0072\u007d\u004e\u004f\u003b\u0059\u0023\u0066\u0058\u0030\u0038\u005a\u004f\u0022\u0037\u0072\u003a\u007b\u0048\u007c\u0029\u0046\u0061\u0040\u005a\u0078\u006e\u0026\u0050\u0044\u005b\u0072\u0074\u0036\u005f\u0023\u007d\u0068\u005a\u0059\u0046\u0057\u005a\u0024\u0068\u002e\u0044\u002f\u0041\u0037\u0036\u0039\u0045\u0048\u006a\u006c\u0045\u0046\u0071\u0026\u0040\u0045\u0025\u0072\u003e\u0031\u0028\u0075\u0021\u0067\u0074\u0078\u0057\u0069\u0054\u0054\u0028\u0064\u003d\u0057\u0050\u003f\u005d\u0074\u007d\u0068\u002f\u0054\u0076\u0051\u006b\u004c\u006a\u0050\u004a\u002e\u004f\u0077\u0050\u006f\u0029\u0046\u0061\u0040\u0043\u0061\u002a\u004b\u0069\u006d\u0031\u005d\u005a\u0079\u004a\u0023\u0077\u0058\u0028\u0071\u0061\u0035\u0044\u004b\u0074\u0071\u0021\u0064\u004a\u0034\u0038\u0036\u007b\u0059\u003f\u005e\u004a\u0061\u004c\u0026\u0045\u0055\u0023\u004e\u0058\u0041\u0045\u0074\u002b\u0047\u006b\u0061\u006a\u006b\u0075\u003b\u0045\u006c\u0041\u0064\u0031\u0022\u0079\u004d\u004b\u0055\u0068\u0075\u0050\u0056\u0055\u0043\u0057\u004f\u0074\u003b\u0032\u006a\u0072\u005a\u0036\u0065\u004e\u0075\u005a\u0076\u005e\u002f\u006e\u0073\u0037\u006e\u0065\u004b\u007b\u0058\u007a\u0074\u003f\u005e\u004a\u0061\u004c\u0026\u0030\u006d\u0058\u007b\u0034\u0022\u005a\u0025\u0021\u0067\u0074\u0078\u0057\u0069\u0054\u0054\u0028\u0064\u003d\u0057\u0050\u003f\u0069\u0050\u007d\u0068\u0065\u004b\u0046\u0057\u005a\u0024\u0025\u0045\u004b\u002f\u0024\u0022\u0056\u004f\u0029\u0046\u0061\u0040\u0043\u0061\u002a\u004b\u0069\u006d\u0031\u005d\u005a\u0079\u003e\u0070\u006b\u0047\u0028\u0071\u0062\u0035\u0044\u004b\u0071\u005d\u0053\u0079\u006d\u0049\u002a\u0023\u0064\u0068\u006a\u006c\u0045\u0046\u005b\u0062\u0065\u006d\u0052\u0064\u0055\u0036\u004f\u0023\u003f\u0055\u0031\u0071\u0079\u0041\u006f\u0069\u006b\u004d\u0034\u003b\u0057\u005f\u004b\u0054\u0048\u0067\u0064\u006d\u0028\u0043\u003e\u0038\u002c\u0026\u0028\u002e\u0041\u0040\u005a\u0058\u007e\u004a\u003d\u0068\u0067\u0069\u0071\u0042\u0057\u004f\u0074\u003b\u0054\u002b\u004c\u0023\u0056\u004d\u004b\u005a\u0041\u0051\u003f\u0062\u0037\u0030\u006e\u0049\u0031\u0053\u004e\u004f\u0065\u0047\u007a\u003d\u005d\u0042\u004c\u0054\u0071\u007e\u0066\u0057\u005d\u0036\u0078\u0074\u005b\u0055\u0062\u0030\u006d\u0061\u0036\u0043\u005a\u0026\u0059\u002e\u006b\u005f\u0058\u0061\u004d\u0029\u0026\u0041\u0067\u0069\u0029\u0054\u0058\u006c\u0048\u002f\u006b\u005f\u0058\u0061\u004d\u0029\u0026\u0041\u0067\u0069\u0029\u0054\u0058\u006c\u005a\u002f\u006b\u005f\u0058\u0061\u004d\u0029\u0026\u0041\u0067\u0069\u0029\u0054\u0058\u006c\u003b\u0058\u0041\u0037\u0058\u0050\u0069\u0067\u003d\u0068\u0024\u0051\u004d\u0042\u0037\u0067\u0044\u002f\u0039\u007b\u005b\u0025\u0021\u0067\u003d\u0035\u006e\u0042\u003c\u005a\u0069\u006d\u0045\u0049\u003a\u007b\u005b\u0025\u0021\u0067\u003d\u0035\u006e\u0042\u003c\u005a\u0069\u006d\u0049\u002e\u0041\u0040\u005a\u0058\u0048\u0055\u0079\u003d\u0057\u0030\u002f\u004b\u006c\u0045\u007d\u005d\u0039\u007b\u005b\u0025\u0021\u0067\u003d\u0035\u006e\u0042\u003c\u005a\u0069\u006d\u0049\u002e\u0041\u0040\u005a\u0058\u0048\u0055\u0079\u003d\u0057\u0030\u002f\u004b\u0070\u0059\u0039\u002f\u0039\u007b\u005b\u0025\u0021\u0067\u003d\u0035\u006e\u0042\u003c\u005a\u0069\u006d\u0049\u002e\u0041\u0040\u005a\u0058\u0048\u0055\u0079\u003d\u0057\u0030\u002f\u004b\u0070\u0059\u0045\u002a\u0039\u007b\u005b\u0025\u0021\u0067\u003d\u0035\u006e\u0042\u003c\u005a\u0069\u006d\u0049\u002e\u002f\u0028\u0022\u006c\u0029\u0046\u0061\u0040\u006f\u0069\u0073\u0054\u003d\u006d\u0048\u0072\u0076\u0053\u004e\u004f\u0062\u0067\u0062\u005a\u0058\u0069\u0048\u0070\u0057\u006c\u007e\u0049\u0029\u0025\u006a\u0074\u005a\u0052\u006a\u006c\u0045\u0046\u0037\u0066\u0069\u006d\u004b\u002f\u006f\u0079\u0058\u0061\u004d\u0029\u002b\u0079\u0076\u0051\u003c\u005a\u003b\u0045\u0049\u002e\u0052\u0036\u006a\u0074\u005a\u0052\u006a\u006c\u0045\u0046\u0037\u0066\u0069\u006d\u004b\u002f\u006f\u0079\u0058\u0061\u004d\u0029\u002b\u0079\u0076\u0051\u003c\u005a\u003b\u0045\u0049\u002e\u003a\u0035\u0078\u0074\u0053\u0068\u003f\u005e\u004a\u0061